INSERT INTO SalesLT.ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (3, 'Chromoly steel.', '301eed3a-1a82-4855-99cb-2afe8290d641', CAST('2007-06-01T00:00:00.000' AS DateTime))
,(4, 'Aluminum alloy cups; large diameter spindle.', 'dfeba528-da11-4650-9d86-cafda7294eb0', CAST('2007-06-01T00:00:00.000' AS DateTime))
,(5, 'Aluminum alloy cups and a hollow axle.', 'f7178da7-1a7e-4997-8470-06737181305e', CAST('2007-06-01T00:00:00.000' AS DateTime))
,(8, 'Suitable for any type of riding, on or off-road. Fits any budget. Smooth-shifting with a comfortable ride.', '8e6746e5-ad97-46e2-bd24-fcea075c3b52', CAST('2007-06-01T00:00:00.000' AS DateTime))
,(64, 'This bike delivers a high-level of performance on a budget. It is responsive and maneuverable, and offers peace-of-mind when you decide to  off-road.', '7b1c4e90-85e2-4792-b47b-e0c424e2ec94', CAST('2007-06-01T00:00:00.000' AS DateTime))
,(88, 'For true trail addicts.  An extremely durable bike that will  anywhere and keep you in control on challenging terrain - without breaking your budget.', '4c1ad253-357e-4a98-b02e-02180aa406f6', CAST('2007-06-01T00:00:00.000' AS DateTime))
,(128, 'Serious back-country riding. Perfect for all levels of competition. Uses the same HL Frame as the Mountain-100.', '130709e6-8512-49b9-9f62-1f5c99152056', CAST('2008-03-11T10:32:17.973' AS DateTime))
,(168, 'Top-of-the-line competition mountain bike. Performance-enhancing options include the innovative HL Frame, super-smooth front suspension, and traction for all terrain.', 'db979da6-4cc8-4171-9ecf-65003ff8178a', CAST('2007-06-01T00:00:00.000' AS DateTime))
,(170, 'Suitable for any type of off-road trip. Fits any budget.', 'ea772412-6369-4416-9cc9-c1a5d1ff9c52', CAST('2007-06-01T00:00:00.000' AS DateTime))
